script: |
  super -f text -I q1969.spq | sort > q1969.out

inputs:
  - name: q1969.spq
    data: |
      SELECT + col0 * + col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN col1 + - 34 / + col2 AND 54 + col2;
  - name: tab2

outputs:
  - name: q1969.out
    data: |
      2346
      4928
      5025
